/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_set_free_charge` BEFORE INSERT ON `tunnel_charges` FOR EACH ROW BEGIN
    IF NEW.peak_start >= 22 OR NEW.peak_end <= 6 THEN
        SET NEW.free_charge = 'Y';
    ELSE
        SET NEW.free_charge = 'N';
    END IF;
END */;;
